value.glsl:
attribute vec3 position;
attribute vec3 color;
uniform mat4 perspective;
varying vec3 vcolor;

void main () {
  gl_Position = perspective * vec4(position, 1);
  vcolor = color;
}


precision mediump float;
varying vec3 vcolor;

void main () {
  gl_FragColor = vec4(vcolor, 1.0);
}

attribute vec3 position;
attribute vec3 color;
uniform mat4 perspective;
varying vec3 vcolor;

void main () {
  gl_Position = perspective * vec4(position, 0.5);
  vcolor = color;
}


precision mediump float;
varying vec3 vcolor;

void main () {
  gl_FragColor = vec4(vcolor, 1.0);
}
